import React from "react";
import {Tile} from "../tile/Tile"

export const TileList = ({data}) => {
  return (
    <div>
     { data.map(({item, ...rest}, index)=>
        <Tile name={item.name} key={index} description={rest}/>

      )}
      
    </div>
  );
};
